[qwstfw]
# Set to true to allow client-initiated downloads.
allow_downloads = false

# These commands are allowed to be executed on your client by the server. The
# following commands are required to make KTX function properly.
[commands]
bf
changing
cmd ack
cmd new
cmd pext
cmd prespawn
cmd spawn
color
infoset
sinfoset
ktx_infoset
ktx_sinfoset
fullserverinfo
on_enter
on_enter_ctf
on_enter_ffa
on_spec_enter
on_spec_enter_ctf
packet
play
rate
reconnect
skin
skins
team

